import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="container">
      <div className="question">게임을 시작하시겠습니까?</div>
      <div className="choice-button">
        <button>시작</button>
      </div>
    </div>
  );
}

export default App;
